import React from 'react';
// import { ReactComponent } from '*.svg';

 class Todo extends React.Component {

    constructor () {
        super();
        this.state = {
            todo_item: ''
        }

    }

    render () {
        return (
            <>
            Todo
            </>
        )
    }
 }
